import React from 'react';
import {Button} from 'react-bootstrap';
const Toolbar = ()=>{
    return(
        <div>
            <Button>Logo</Button>{'     '}
            <Button>Inicio</Button>{' '}
            <Button>Siguiendo</Button>{' '}
        </div>
    )
}
export default Toolbar;
